#!/usr/bin/env python3
import importlib.util, base64
pycMagic = importlib.util.MAGIC_NUMBER

pycs = {
    b'\x55\x0d\x0d\x0a': "", # 38
    b'\x61\x0d\x0d\x0a': "", # 39
    b'\x6f\x0d\x0d\x0a': "", # 310
    b'\xa7\x0d\x0d\x0a': "", # 311
    b'\xcb\x0d\x0d\x0a': "", # 312
    b'\xf3\x0d\x0d\x0a': "", # 313
}

if pycMagic not in pycs:
    print("Can't launch! Upgrade to Python 3.8 — 3.13")
    exit(1)

open("embedded.pyc", "wb").write(base64.b64decode(pycs[pycMagic]))

__import__("embedded")
